BEGIN TRANSACTION;
CREATE TABLE Class (
            class_id INTEGER NOT NULL,
            subject_id INTEGER NOT NULL,
            teacher_id INTEGER NOT NULL,
            PRIMARY KEY (class_id),
            FOREIGN KEY (subject_id) REFERENCES Subject(subject_id),
            FOREIGN KEY (teacher_id) REFERENCES Teacher(teacher_id)
        );
CREATE TABLE ImportTable (
            teacher_id INTEGER NOT NULL,
            teacher_title TEXT,
            teacher_surname TEXT,
            subject_id TEXT NOT NULL,
            subject_name TEXT,
            student_id INTEGER NOT NULL,
            student_first_name TEXT,
            student_surname TEXT,
            student_year TEXT,
            parent_id INTEGER NOT NULL,
            parent_first_name TEXT,
            parent_surname TEXT,
            parent_email TEXT
        );
CREATE TABLE Parent (
            parent_id INTEGER NOT NULL,
            parent_first_name TEXT,
            parent_surname TEXT,
            parent_email TEXT,
            PRIMARY KEY (parent_id)
        );
CREATE TABLE Student (
            student_id INTEGER NOT NULL,
            student_first_name TEXT,
            student_surname TEXT,
            student_year TEXT,
            parent_id INTEGER NOT NULL,
            PRIMARY KEY (student_id),
            FOREIGN KEY (parent_id) REFERENCES Parent(parent_id)
        );
CREATE TABLE Student_Class (
            student_id_fk INTEGER NOT NULL,
            class_id_fk INTEGER NOT NULL,
            PRIMARY KEY (student_id_fk, class_id_fk),
            FOREIGN KEY (student_id_fk) REFERENCES Student(student_id),
            FOREIGN KEY (class_id_fk) REFERENCES Class(class_id)
        );
CREATE TABLE Subject (
            subject_id TEXT NOT NULL,
            subject_name TEXT,
            PRIMARY KEY (subject_id)
        );
CREATE TABLE Teacher (
            teacher_id INTEGER NOT NULL,
            teacher_title TEXT,
            teacher_surname TEXT,
            PRIMARY KEY (teacher_id)
        );
COMMIT;
